var output = {};

for(var key in createdEntries) {
    var dbEntryList = dbEntries[key];
    if(dbEntryList === undefined) dbEntryList = [];
    output[key] = dbEntryList;
}

return output;

var getSinglesFileEntry = entry => entry[0].fileEntry;
var isPropRules = record => (record.Fields.file_type_id == 21);
var isNonStandard= record => (record.Fields.option_name != "Standard");
var isStandard= record => (record.Fields.option_name == "Standard");

var isPropRulesMulti = entry => (entry[0].fileEntry.Fields.file_type_id == 21);

var singles = [];
var multis = [];
for(var key in dbEntries) {
    var list = dbEntries[key];
    if(list.length > 1) {
        multis.push(list);
    }
    else {
        singles.push(list);
    }
}
var output = {};
var propRuleEntries = singles.map(getSinglesFileEntry).filter(isPropRules);
output.singlesNonStandard = propRuleEntries.filter(isNonStandard);
output.singlesStandard = propRuleEntries.filter(isStandard);
output.multis = multis.filter(isPropRulesMulti);

return output;

var output = {};

var addToOutput = record => {
    var key = record.Fields.entry_key.toUpperCase();
    var list = output[key];
    if(!list) {
        list = [];
        output[key] = list;
    }
    list.push(record);
}

nonStandardDbPropRulesEntries.singlesNonStandard.forEach(addToOutput);

return output;

var output = {};

for(var key in singleNonStandardCapKey) {
    var list = singleNonStandardCapKey[key];
    var countKey = list.length;
    var outList = output[countKey];
    if(!outList) {
        outList = [];
        output[countKey] = outList;
    }
    outList.push(list);
}

return output;
